import Layout from "../components/BaseLayout";
import Link from "next/link";

const PostLink = (props) => {
  <li>
    <Link href={`single?title=$(props.title)`}>
      <a>{props.title}</a>
    </Link>
  </li>;
};

const Blog = () => (
  <Layout>
    <h1>Welcome to Blog</h1>
    <ul>
      <PostLink title="Blog Pertama" />
    </ul>
  </Layout>
);

export default Blog;
